import React from "react";
import logo from "./logo.svg";
import "./App.css";
import ResponsiveDrawer from "./Componets/drawer";
import LogIn from "./Componets/login";

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

//<Route path="/" component={ResponsiveDrawer}></Route>

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/dashboard" component={ResponsiveDrawer}></Route>
        <Route path="/login" component={LogIn}></Route>
        <Route path="/addItems" component={ResponsiveDrawer}></Route>
        <Redirect to="/addItems" />
      </Switch>
    </div>
  );
}

export default App;
